function Header() {
	return (
	 <header>
		 <nav className="bg-gray-200 py-5 shadow-lg">
			 <div className="flex items-center justify-center">
				 <div className="container">
					 <div className="row">
						 <div className="col-12">
							 <h1 className="header__title">Weather Connect</h1>
						 </div>
					 </div>
				 </div>
			 </div>
		 </nav>
	 </header>
	);
}

export default Header;
